import {ColorInterpolater} from "../class/color-interpolater";
import {Shade} from "./shade.model";

export class Color {

  name: string

  shades: Shade[]

  constructor(
    name: string,
    hex: string
  ) {
    if (!hex.startsWith('#') || hex.length !== 7)
      throw `Color '${hex}' is not in form #RRGGBB.`

    this.name = name
    this.shades = ColorInterpolater.interpolateShades(hex)

    this.shades.sort((a, b) => a.index - b.index)
  }

  getShade(index: number) {
    return this.shades.find(s => s.index === index)
  }

}

export class ColorConverter {

  static rgbToHsl(color: string) {
    if (!color.startsWith('#') || color.length !== 7)
      throw `Color '${color}' is not in form #RRGGBB.`

    const r = parseInt(color.substring(1, 3), 16) / 255
    const g = parseInt(color.substring(3, 5), 16) / 255
    const b = parseInt(color.substring(5, 7), 16) / 255

    const cMax = Math.max(r, g, b)
    const cMin = Math.min(r, g, b)
    const d = cMax - cMin

    const l = this.getLightnessFromRgb(cMax, cMin)
    const s = this.getSaturation(d, l)
    let h = this.getHue(d, cMax, r, g, b)
    if (h < 0)
      h += 360

    return {
      hue: Math.round(h),
      saturation: Math.round(s),
      luminosity: Math.round(l)
    }
  }

  private static getLightnessFromRgb(cMax: number, cMin: number): number {
    return (cMax + cMin) * 50
  }

  private static getSaturation(d: number, l: number): number {
    if (d === 0)
      return 0
    else
      return 100 * d / (1 - Math.abs(2 * (l / 100) - 1))
  }

  private static getHue(d: number, cMax: number, r: number, g: number, b: number): number {
    if (d === 0)
      return 0
    else if (cMax === r)
      return 60 * ( ( (g - b) / d) % 6)
    else if (cMax === g)
      return 60 * ( ( (b - r) / d) + 2)
    else
      return 60 * ( ( (r - g) / d) + 4)
  }


  static hslToRgb(hue: number, saturation: number, lightness: number): string {
    if (hue < 0 || hue > 360 || saturation < 0 || saturation > 100 || lightness < 0 || lightness > 100)
      throw `Color values [${hue}Â°, ${saturation}%, ${lightness}%] are not in valid ranges.`

    const h = hue
    const s = saturation / 100
    const l = lightness / 100

    const c = (1 - Math.abs(2 * l - 1)) * s
    const x = c * (1 - Math.abs((h / 60) % 2 - 1))
    const m = l - c / 2

    const r = (h < 60 || h >=300) ? c : (h < 120 || h >= 240) ? x : 0
    const g = (h >= 240) ? 0 : (h < 60 || h >= 180) ? x : c
    const b = (h < 120) ? 0 : (h < 180 || h >= 300) ? x : c

    const R = Math.round((r + m) * 255)
    const G = Math.round((g + m) * 255)
    const B = Math.round((b + m) * 255)

    return `#${(R < 16 ? 0 : '') + R.toString(16)}${(G < 16 ? 0 : '') + G.toString(16)}${(B < 16 ? 0 : '') + B.toString(16)}`
  }

}

import {ColorConverter} from "./color-converter";
import {Shade} from "../models/shade.model";

export class ColorInterpolater {

  static interpolateShades(color: string) {
    if (!color.startsWith('#') || color.length !== 7)
      throw `Color '${color}' is not in form #RRGGBB.`

    const shades: Shade[] = []
    const hsl = ColorConverter.rgbToHsl(color)

    if (100 - hsl.luminosity < 7.5) {
      shades.push(new Shade(50, color))
      this.generateDarkerColors(hsl, 0, shades)
    } else if (100 - hsl.luminosity >= 85) {
      shades.push(new Shade(900, color))
      this.generateLighterColors(hsl, 900, shades)
    } else {
      let index = 100
      while (100 - hsl.luminosity > (index / 10) + 5)
        index += 100
      shades.push(new Shade(index, color))
      this.generateLighterColors(hsl, index, shades)
      this.generateDarkerColors(hsl, index, shades)
    }

    return shades
  }

  private static generateLighterColors(hslColor: { saturation: number; hue: number; luminosity: number }, step: number, shades: Shade[]) {
    const index = step / 100
    let i = 1

    for (; i < index; i++) {
      const interpolatedLuminosity = hslColor.luminosity + (i / index) * (100 - hslColor.luminosity)
      const newIndex = step - i * 100
      shades.push(new Shade(newIndex, hslColor.hue, hslColor.saturation, interpolatedLuminosity))
    }

    const interpolatedLuminosity = hslColor.luminosity + ((2 * i - 1) / (2 * index)) * (100 - hslColor.luminosity)
    shades.push(new Shade(50, hslColor.hue, hslColor.saturation, interpolatedLuminosity))
  }

  private static generateDarkerColors(hslColor: { saturation: number; hue: number; luminosity: number }, step: number, shades: Shade[]) {
    const index = (1000 - step) / 100
    let i = 1

    for (; i < index; i++) {
      const interpolatedLuminosity = hslColor.luminosity - (i / index) * hslColor.luminosity
      const newIndex = step + i * 100
      shades.push(new Shade(newIndex, hslColor.hue, hslColor.saturation, interpolatedLuminosity))
    }
  }

}

import {Color} from "./color.model";

export class Palette {

  title: string
  id: string
  colors: Color[] = []

  constructor(title: string) {
    this.title = title
    this.id = 'sfhaislfhasbfshgf'
  }

  addColor(name: string, hex: string) {
    this.colors.push(new Color(name, hex))
  }

}

import {ColorConverter} from "../class/color-converter";

export class Shade {

  index: number
  hex: string
  hue: number
  saturation: number
  luminosity: number

  public constructor(index: number, hex: string);
  public constructor(index: number, hue: number, saturation: number, luminosity: number);
  public constructor(index: number, hex: string, hue: number, saturation: number, luminosity: number);

  public constructor(...args: any[]) {
    this.index = args[0]

    if (args.length === 2) {
      this.hex = args[1]
      const hsl = ColorConverter.rgbToHsl(this.hex)
      this.hue = hsl.hue
      this.saturation = hsl.saturation
      this.luminosity = hsl.luminosity
    } else if (args.length === 4) {
      this.hex = ColorConverter.hslToRgb(args[1], args[2], args[3])
      this.hue = args[1]
      this.saturation = args[2]
      this.luminosity = args[3]
    } else {
      this.hex = args[1]
      this.hue = args[2]
      this.saturation = args[3]
      this.luminosity = args[4]
    }
  }

}

